import React from 'react';
import './App.css';
import Header from './Header';
import Technologies from './Technologies';
import Footer from './Footer';

const App = () => {
  return (
    <div>
      <Header />
      <Technologies />
      <Footer />
    </div>
  );
}

export default App;
